import React,{useState, useEffect} from 'react';
import axio from 'axios';

const Moviesearch = () => {
    const [moviedata, setmoviedata] = useState(
       [{
            Actors: "",
            Awards: "",
            Country: "",
            Director: "",
            Genre: "",
            Language: "",
            Metascore: "",
            Plot: "",
            Poster: "",
            Rated: "",
            Ratings: [{Source: "", Value: ""}],
            Released: "",
            Response: "",
            Runtime: "",
            Title: "",
            Type: "",
            Writer: "",
            Year: "",
            imdbID: "",
            imdbRating: "",
            imdbVotes: "",
            totalSeasons: ""
        }]
    )
    async function getmoviedata(){
        const res = await axio.get("http://www.omdbapi.com/?t=scam+1992&apikey=511b46e");
        setmoviedata(res);
    }
    getmoviedata();
    return(
        <>
        <h1>Movie Search</h1>
            {moviedata.map((val, index) => {
                   return (
                    <div key={index} className="card" style={{width: "14.5rem", padding: "10px"}}>
                    <img src={val.Poster} className="card-img-top" alt="..." />
                    <div className="card-body" style={{padding: "0px"}}>
                        <h6 className="card-title">Author: {val.Title}</h6>
                    </div>
                    </div>
                   )
                 })
            }
        </>
    )

}
export default Moviesearch;
